
def ath(start, end, path, cfg):

	visit = {}
	visit[start] = True
	path.append(start)
	for node in cfg[start]:
		if node not in path:
			ath(node, end, path, cfg)


def add_node(end):

	global cfg
	global list
	for i in cfg.keys():
		if end in cfg[i]:
			if i not in list:
				list.append(i)
				add_node(i)


